import ReactDom, { render } from 'react-dom';
const TodoList = () => {
    return (
        <ul>
            <li>Learn React</li>
            <li>Buil Awesome App</li>
        </ul>
    );
};
const AppHeader = () => {
    return (
        <h1>My todoList</h1>
    );
};
const SearchPanel = () => {
    return (
        <input placeholder="search" />
    );
};
const el = (
    <div>
    <AppHeader/> 
       <SearchPanel />
       <TodoList/>
    </div>
);
